package coreJava;

public class Operator {

	public static void main(String[] args) {
		// TODO Auto-generated method stub

		
		int num1 = 8;
		
		num1 = num1+1;
		System.out.println(num1);//9
		num1 +=2;
		System.out.println(num1);//11
		
		num1 = num1++;//11
		System.out.println(num1);
		num1 =++num1;//12
		
		System.out.println(num1);
		
		
	}

}
